const linkStyle = {
    marginRight: 15
}

const Menu = () => (
    <div className="links">
        <Link href="/">
        <a style={linkStyle}>Home</a>
        </Link>
        <Link href="/about">
        <a>About</a>
        </Link>
        <Link href="/projects">
        <a>Projects</a>
        </Link>
        <Link href="/contact">
        <a>Contact</a>
        </Link>
<style jsx>{`
.links {
    border-bottom: 1px solid blue;
}
`}</style>
    </div>
)

export default Menu;
